import React from 'react';
import './NavBar.css';
import logo from '../images/logo.png';

const NavBar = () => {
  return (
    <div className='hero'>
      <nav>
        <h2 className='logo'><img src={logo} alt='Logo'/></h2>
        <ul>
          <li><a href='/'>Home</a></li>
          <li><a href='/'>About</a></li>
          <li><a href='/'>Contact</a></li>
        </ul>
        <button type='button'>Login</button>
      </nav>
    </div>
  );
};

export default NavBar;
